        public TdrError.ErrorType getSizeInfo(byte[] buffer ,int size , ref uint sizeInfo)
        {
                if (0 == buffer.GetLength(0) || size > buffer.GetLength(0))
                {
#if (DEBUG)
                        StackTrace st = new StackTrace(true);
                        for (int i = 0; i < st.FrameCount; i++)
                        {
