#endif
                    return TdrError.ErrorType.TDR_ERR_INVALID_BUFFER_PARAMETER;
                }

                TdrReadBuf srcBuf = new TdrReadBuf(ref buffer, size);
                TdrError.ErrorType ret = getSizeInfo(srcBuf, ref sizeInfo);

                return ret;
        }
